import React from "react";
import GroupData from "./Group";
import AppMain from "./groupExpense";

const ShowData = () => {
    const data = {
        groupName: "subway",
        paidByName: "Om",
        amount: "1000",
        members: [
            { name: "You", amount: "200.00" },
            { name: "Om", amount: "200.00" },
            { name: "Sapna", amount: "200.00" },
            { name: "Shruti", amount: "200.00" },
            { name: "Shivani", amount: "200.00" },
        ],
    };

    return (
        <div>
            <GroupData {...data} />
            <button onClick={<AppMain />}>Add Expense</button>
        </div>
    );
};

export default ShowData;
